
CREATE TABLE aircraftDetails (aircraft_number INT,
							  aircraft_assigned_airline VARCHAR(100),
							  aircraft_photo VARCHAR(200),
							  aircraft_web_link VARCHAR(200),
							  aircraft_type VARCHAR(100),
							  aircraft_serial_number INT,
							  aircraft_registration_code VARCHAR(20),
							  aircraft_manufactured_date Date,
							  aircraft_country_of_registration VARCHAR(50),
							  aircraft_country_of_registration_flag VARCHAR(300),
							  aircraft_icao_twenty_four_bit_address VARCHAR(10),
							  aircraft_size VARCHAR(50),
							  aircraft_wing_type VARCHAR(50),
							  aircraft_fuel_capacity INT,
							  aircraft_has_anti_icing_and_de_icing_systems VARCHAR(5),
							  aircraft_max_altitude INT,
							  aircraft_max_cruising_speed INT,
							  aircraft_max_travel_range_without_refueling INT
							 );

